experience.description:
Разработка web-приложения с нуля:
- Микросервисная архитектура;
- Интеграция с мэйлами по SMTP/IMAP протоколам;
- Безопасность

- поиск и оценка инновационных технологий, предложение их внедрения;
- определение сроков работы над IT-проектами;
- реализация ИТ-стратегии компании;
- планирование эффективной реализации IT-проектов;
- разработка и обеспечение качественных ИТ-услуг;
- переговоры с клиентами и поставщиками оборудования;
- участие в разработке проектов (программирование)

- обеспечение безошибочной работы системного программного обеспечения (ОС Windows, Windows Server);
- обеспечение работоспособности и безопасности сети компании;
- обеспечение резервного копирования данных (а также восстановление данных при необходимости);
- установка и поддержка серверов

- поддержка, обучение и консультирование сотрудников компании по вопросам, касающимся компьютеров и программного обеспечения;
- оперативная помощь сотрудникам по устранению неисправностей, определять, локализировать и устранять ошибки (сбои);
- принятие и фиксирование в HelpDesk системе заявки от пользователей, контролировать процесс их устранения;
- выполнение работы по установке и настройке программ и программных средств, утвержденных политикой компании;
- установка новых рабочих мест и осуществление переноса существующих;
- настройка ПК и КПК, мобильные телефоны на базе IOS, Android, тестирование, выявление и устранение неисправности компьютеров и копировальной техники
